import React, { Component } from "react"

export default class NewAppointmentForm extends Component {
    state= {
        userId: "",
        doctorId: "",
        time: "",
        date: "",
        reason: "",
        noteId: ""
    }

    handleFieldChange = evt => {
        const stateToChange={};
        stateToChange[evt.target.id] = evt.target.value;
        this.setState(stateToChange);
    }
}
